import {QuizServiceStub} from "src/app/services/QuizServiceStub";
import {IS_MODE_STUB, BASE_URL} from "src/app/config.json";

const serviceConfig: {pathToData: string} = "../store/data.json";

// Creating a new class based on Example Service
export const quizService = IS_MODE_STUB ? new QuizServiceStub(serviceConfig) : new QuizService(BASE_URL);

export const projectsService = IS_MODE_STUB ? new ProjectsServiceStub() : new ProjectService(BASE_URL);
